Moody gal V day look 💔🗡, inspired by a request for an “angry Valentine’s Day look” featuring the SELF CRUSH SET from @halfmagicbeauty // If you know me you know I live for designing looks that have any morsels of underlying emotion. I took a little inspo from Jules’ NYE eyeliner look + added black iridescent stick-on pearls and a crazy exaggerated diffused lip. Swipe to see a couple other versions of the look with lip and eyeliner variations 🤓

EYES
@halfmagicbeauty #magicflik eyeliner / stick-on pearls / eyeshadow single in Pretty Robot 

CHEEKS
@halfmagicbeauty #cheekfluff blush in Sexual Flushtration 

LIPS
@halfmagic #mouthcloud in Edward’s Fantasy / sculptitude dual ended lipliners in Sugar Plum B*tch & Fancy Cherry / eyeshadow single in Pretty Robot as a halo around lips in the first slide 

FACE
@kosas #revealerfoundation (loving that!) + @armanibeauty luminous silk concealer

I did my first red carpet glam, and of course it was on @dylanmulvaney for @goldenglobes! The vibe: pink ice princess soft glam. Frosty bubblegum pink eyes w/ spikey lashes & bleached brows 🎀🧊 

